import React from 'react';

const MenuPage = ({ match }) => {
    return (
        <div>
            <h1>{match.params.menuName}</h1>
            <p>This is a placeholder page for the {match.params.menuName} menu item.</p>
        </div>
    );
};

export default MenuPage;
